insert into card (card_id, answer, question, rating, title, deck_id) values (1, 'There are 4 access modifiers in Java: public, protected, default and private', 'How many access modifiers do you know in Java?', 0, 'Card 1', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (2, 'Java runs on a variety of platforms, such as Windows, Mac OS, and the various versions of UNIX/Linux like HP-Unix, Sun Solaris, Redhat Linux, Ubuntu, CentOS, etc.', 'What are the supported platforms by Java Programming Language?', 0, 'Card 2', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (3, 'Some features include Object Oriented, Platform Independent, Robust, Interpreted, Multi-threaded', 'List any five features of Java?', 0, 'Card 3', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (4, 'It’s compiler generates an architecture-neutral object file format, which makes the compiled code to be executable on many processors, with the presence of Java runtime system.', 'Why is Java Architectural Neutral?', 0, 'Card 4', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (5, 'Java uses Just-In-Time compiler to enable high performance. Just-In-Time compiler is a program that turns Java bytecode, which is a program that contains instructions that must be interpreted into instructions that can be sent directly to the processor.', 'How Java enabled High Performance?', 0, 'Card 5', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (6, 'It is designed to adapt to an evolving environment. Java programs can carry extensive amount of run-time information that can be used to verify and resolve accesses to objects on run-time.', 'Why Java is considered dynamic?', 0, 'Card 6', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (7, 'When Java is compiled, it is not compiled into platform specific machine, rather into platform independent byte code. This byte code is distributed over the web and interpreted by virtual Machine (JVM) on whichever platform it is being run.', 'What is Java Virtual Machine and how it is considered in context of Java’s platform independent feature?', 0, 'Card 7', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (8, 'Netbeans, Eclipse, etc.', 'List two Java IDE’s?', 0, 'Card 8', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (9, 'Some Java keywords are import, super, finally, etc.', 'List some Java keywords(unlike C, C++ keywords)?', 0, 'Card 9', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (10, 'Object is a runtime entity and it’s state is stored in fields and behavior is shown via methods. Methods operate on an objects internal state and serve as the primary mechanism for object-to-object communication.', 'What do you mean by Object?', 0, 'Card 10', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (11, 'A class is a blue print from which individual objects are created. A class can contain fields and methods to describe the behavior of an object.', 'Define class?', 0, 'Card 11', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (12, 'A class consist of Local variable, instance variables and class variables.', 'What kind of variables a class can consist of?', 0, 'Card 12', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (13, 'Variables defined inside methods, constructors or blocks are called local variables. The variable will be declared and initialized within the method and it will be destroyed when the method has completed.', 'What is a Local Variable?', 0, 'Card 13', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (14, 'Instance variables are variables within a class but outside any method. These variables are instantiated when the class is loaded.', 'What is a Instance Variable?', 0, 'Card 14', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (15, 'These are variables declared with in a class, outside any method, with the static keyword.', 'What is a Class Variable?', 0, 'Card 15', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (16, 'Singleton class control object creation, limiting the number to one but allowing the flexibility to create more objects if the situation changes.', 'What is Singleton class?', 0, 'Card 16', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (17, 'Constructor gets invoked when a new object is created. Every class has a constructor. If we do not explicitly write a constructor for a class the java compiler builds a default constructor for that class.', 'What do you mean by Constructor?', 0, 'Card 17', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (18, 'An Object is first declared, then instantiated and then it is initialized.', 'List the three steps for creating an Object for a class?', 0, 'Card 18', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (19, 'Default value of byte datatype is 0.', 'What is the default value of byte datatype in Java?', 0, 'Card 19', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (20, 'Default value of float and double datatype in different as compared to C/C++. For float its 0.0f and for double it’s 0.0d', 'What is the default value of float and double datatype in Java?', 0, 'Card 20', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (21, 'This data type is used to save space in large arrays, mainly in place of integers, since a byte is four times smaller than an int.', 'When a byte datatype is used?', 0, 'Card 21', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (22, 'Class variables also known as static variables are declared with the static keyword in a class, but outside a method, constructor or a block.', 'What is a static variable?', 0, 'Card 22', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (23, 'Java provides access modifiers to set access levels for classes, variables, methods and constructors. A member has package or default accessibility when no accessibility modifier is specified.', 'What do you mean by Access Modifier?', 0, 'Card 23', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (24, 'Variables, methods and constructors which are declared protected in a superclass can be accessed only by the subclasses in other package or any class within the package of the protected members class.', 'What is protected access modifier?', 0, 'Card 24', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (25, 'Java provides these modifiers for providing functionalities other than Access Modifiers, synchronized used to indicate that a method can be accessed by only one thread at a time.', 'What do you mean by synchronized Non Access Modifier?', 0, 'Card 25', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (26, 'Postfix operators i.e () [] . is at the highest precedence.', 'According to Java Operator precedence, which operator is considered to be with highest precedence?', 0, 'Card 26', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (27, 'Variables used in a switch statement can only be a string, enum, byte, short, int, or char.', 'Variables used in a switch statement can be used with which datatypes?', 0, 'Card 27', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (28, 'This method is used to get the primitive data type of a certain String.', 'When parseInt() method can be used?', 0, 'Card 28', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (29, 'The String class is immutable, so that once it is created a String object cannot be changed. Since String is immutable it can safely be shared between many threads ,which is considered very important for multithreaded programming.', 'Why is String class considered immutable?', 0, 'Card 29', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (30, 'The String class is considered as immutable, so that once it is created a String object cannot be changed. If there is a necessity to make alot of modifications to Strings of characters then StringBuffer should be used.', 'Why is StringBuffer called mutable?', 0, 'Card 30', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (31, 'Use StringBuilder whenever possible because it is faster than StringBuffer. But, if thread safety is necessary then use StringBuffer objects.', 'What is the difference between StringBuffer and StringBuilder class?', 0, 'Card 31', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (32, 'java.util.regex package is used for this purpose.', 'Which package is used for pattern matching with regular expressions?', 0, 'Card 32', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (33, 'java.util.regex consists of three classes − Pattern class, Matcher class and PatternSyntaxException class.', 'java.util.regex consists of which classes?', 0, 'Card 33', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (34, 'It is possible to define a method that will be called just before an objects final destruction by the garbage collector. This method is called finalize( ), and it can be used to ensure that an object terminates cleanly.', 'What is finalize() method?', 0, 'Card 34', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (35, 'An exception is a problem that arises during the execution of a program. Exceptions are caught by handlers positioned along the threads method invocation stack.', 'What is an Exception?', 0, 'Card 35', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (36, 'It is an exception that is typically a user error or a problem that cannot be foreseen by the programmer. For example, if a file is to be opened, but the file cannot be found, an exception occurs. These exceptions cannot simply be ignored at the time of compilation.', 'What do you mean by Checked Exceptions?', 0, 'Card 36', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (37, 'It is an exception that occurs that probably could have been avoided by the programmer. As opposed to checked exceptions, runtime exceptions are ignored at the time of compliation.', 'Explain Runtime Exceptions?', 0, 'Card 37', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (38, 'The Exception class has two main subclasses : IOException class and RuntimeException Class.', 'Which are the two subclasses under Exception class?', 0, 'Card 38', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (39, 'If a method does not handle a checked exception, the method must declare it using the throwskeyword. The throws keyword appears at the end of a methods signature.', 'When throws keyword is used?', 0, 'Card 39', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (40, 'An exception can be thrown, either a newly instantiated one or an exception that you just caught, by using throw keyword.', 'When throw keyword is used?', 0, 'Card 40', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (41, 'The finally keyword is used to create a block of code that follows a try block. A finally block of code always executes, whether or not an exception has occurred.', 'How finally used under Exception Handling?', 0, 'Card 41', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (42, 'It is the process where one object acquires the properties of another. With the use of inheritance the information is made manageable in a hierarchical order.', 'Define Inheritance?', 0, 'Card 42', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (43, 'If the method overrides one of its superclasss methods, overridden method can be invoked through the use of the keyword super. It can be also used to refer to a hidden field.', 'When super keyword is used?', 0, 'Card 43', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (44, 'Polymorphism is the ability of an object to take on many forms. The most common use of polymorphism in OOP occurs when a parent class reference is used to refer to a child class object.', 'What is Polymorphism?', 0, 'Card 44', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (45, 'It refers to the ability to make a class abstract in OOP. It helps to reduce the complexity and also improves the maintainability of the system.', 'What is Abstraction?', 0, 'Card 45', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (46, 'These classes cannot be instantiated and are either partially implemented or not at all implemented. This class contains one or more abstract methods which are simply method declarations without a body.', 'What is Abstract class?', 0, 'Card 46', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (47, 'If you want a class to contain a particular method but you want the actual implementation of that method to be determined by child classes, you can declare the method in the parent class as abstract.', 'When Abstract methods are used?', 0, 'Card 47', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (48, 'It is the technique of making the fields in a class private and providing access to the fields via public methods. If a field is declared private, it cannot be accessed by anyone outside the class, thereby hiding the fields within the class. Therefore encapsulation is also referred to as data hiding.', 'What is Encapsulation?', 0, 'Card 48', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (49, 'The main benefit of encapsulation is the ability to modify our implemented code without breaking the code of others who use our code. With this Encapsulation gives maintainability, flexibility and extensibility to our code.', 'What is the primary benefit of Encapsulation?', 0, 'Card 49', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (50, 'An interface is a collection of abstract methods. A class implements an interface, thereby inheriting the abstract methods of the interface.', 'What is an Interface?', 0, 'Card 50', 1);
insert into card (card_id, answer, question, rating, title, deck_id) values (51, 'A Package can be defined as a grouping of related types(classes, interfaces, enumerations and annotations ) providing access protection and name space management.', 'Define Packages in Java?', 0, 'Card 51', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (52, 'Packages are used in Java in-order to prevent naming conflicts, to control access, to make searching/locating and usage of classes, interfaces, enumerations and annotations, etc., easier.', 'Why Packages are used?', 0, 'Card 52', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (53, 'A multithreaded program contains two or more parts that can run concurrently. Each part of such a program is called a thread, and each thread defines a separate path of execution.', 'What do you mean by Multithreaded program?', 0, 'Card 53', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (54, 'Thread can be created by: implementing Runnable interface, extending the Thread class.', 'What are the two ways in which Thread can be created?', 0, 'Card 54', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (55, 'An applet is a Java program that runs in a Web browser. An applet can be a fully functional Java application because it has the entire Java API at its disposal.', 'What is an applet?', 0, 'Card 55', 2);
