insert into card (card_id, answer, question, rating, title, deck_id) values (57, 'It uses garbage collection to free the memory. By cleaning those objects that is no longer reference by any of the program.', 'Explain garbage collection in Java?', 0, 'Card 57', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (58, 'An immutable object can’t be changed once it is created.', 'Define immutable object?', 0, 'Card 58', 2);
