insert into card (card_id, answer, question, rating, title, deck_id) values (60, 'It is a collection of element which cannot contain duplicate elements. The Set interface contains only methods inherited from Collection and adds the restriction that duplicate elements are prohibited.', 'Explain Set Interface?', 0, 'Card 60', 2);
