insert into card (card_id, answer, question, rating, title, deck_id) values (63, 'Java Runtime Environment is an implementation of the Java Virtual Machine which executes Java programs. It provides the minimum requirements for executing a Java application;', 'Define JRE i.e. Java Runtime Environment?', 0, 'Card 63', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (64, 'JAR files is Java Archive fles and it aggregates many files into one. It holds Java classes in a library. JAR files are built on ZIP file format and have .jar file extension.', 'What is JAR file?', 0, 'Card 64', 2);
