insert into card (card_id, answer, question, rating, title, deck_id) values (71, 'Holding the reference of the other class within some other class is known as composition.', 'Define composition?', 0, 'Card 71', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (72, 'If a class has multiple functions by same name but different parameters, it is known as Method Overloading.', 'What is function overloading?', 0, 'Card 72', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (73, 'If a subclass provides a specific implementation of a method that is already provided by its parent class, it is known as Method Overriding.', 'What is function overriding?', 0, 'Card 73', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (74, 'Method overloading increases the readability of the program. Method overriding provides the specific implementation of the method that is already provided by its super class parameter must be different in case of overloading, parameter must be same in case of overriding.', 'Difference between Overloading and Overriding?', 0, 'Card 74', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (75, 'Final classes are created so the methods implemented by that class cannot be overridden. It can’t be inherited.', 'What is final class?', 0, 'Card 75', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (76, 'A NullPointerException is thrown when calling the instance method of a null object, accessing or modifying the field of a null object etc.', 'What is NullPointerException?', 0, 'Card 76', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (77, 'A thread can enter the waiting state by invoking its sleep() method, by blocking on IO, by unsuccessfully attempting to acquire an objects lock, or by invoking an objects wait() method. It can also enter the waiting state by invoking its (deprecated) suspend() method.', 'What are the ways in which a thread can enter the waiting state?', 0, 'Card 77', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (78, 'The operating systems task scheduler allocates execution time to multiple tasks. By quickly switching between executing tasks, it creates the impression that tasks execute sequentially.', 'How does multi-threading take place on a computer with a single CPU?', 0, 'Card 78', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (79, 'After a thread is started, via its start() method of the Thread class, the JVM invokes the threads run() method when the thread is initially executed.', 'What invokes a threads run() method?', 0, 'Card 79', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (80, 'Yes, it does. The FileNoFoundException is inherited from the IOException. Exceptions subclasses have to be caught first.', 'Does it matter in what order catch statements for FileNotFoundException and IOException are written?', 0, 'Card 80', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (81, 'When a task invokes its yield() method, it returns to the ready state. When a task invokes its sleep() method, it returns to the waiting state.', 'What is the difference between yielding and sleeping?', 0, 'Card 81', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (82, 'The Vector class provides the capability to implement a growable array of objects. Vector proves to be very useful if you dont know the size of the array in advance, or you just need one that can change sizes over the lifetime of a program.', 'Why Vector class is used?', 0, 'Card 82', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (83, 'Unicode requires 16 bits and ASCII require 7 bits. Although the ASCII character set uses only 7 bits, it is usually represented as 8 bits. UTF-8 represents characters using 8, 16, and 18 bit patterns. UTF-16 uses 16-bit and larger bit patterns.', 'How many bits are used to represent Unicode, ASCII, UTF-16, and UTF-8 characters?', 0, 'Card 83', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (84, 'These are classes that allow primitive types to be accessed as objects. Example: Integer, Character, Double, Boolean etc.', 'What are Wrapper classes?', 0, 'Card 84', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (85, 'The Frame class extends Window to define a main application window that can have a menu bar.', 'What is the difference between a Window and a Frame?', 0, 'Card 85', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (86, 'javax.Swing package. All components in Swing, except JApplet, JDialog, JFrame and JWindow are lightweight components.', 'Which package has light weight components?', 0, 'Card 86', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (87, 'The paint() method supports painting via a Graphics object. The repaint() method is used to cause paint() to be invoked by the AWT painting thread.', 'What is the difference between the paint() and repaint() methods?', 0, 'Card 87', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (88, 'It is used to create objects that provide access to the files and directories of a local file system.', 'What is the purpose of File class?', 0, 'Card 88', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (89, 'The Reader/Writer class hierarchy is character-oriented, and the InputStream/OutputStream class hierarchy is byte-oriented.', 'What is the difference between the Reader/Writer class hierarchy and the InputStream/OutputStream class hierarchy?', 0, 'Card 89', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (90, 'The Class class is used to obtain information about an objects design and java.lang.Class class instance represent classes, interfaces in a running Java application.', 'Which class should you use to obtain design information about an object?', 0, 'Card 90', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (91, 'A static variable is associated with the class as a whole rather than with specific instances of a class. Non-static variables take on unique values with each object instance.', 'What is the difference between static and non-static variables?', 0, 'Card 91', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (92, 'Serialization is the process of writing the state of an object to a byte stream. Deserialization is the process of restoring these objects.', 'What is Serialization and deserialization?', 0, 'Card 92', 2);
