insert into card (card_id, answer, question, rating, title, deck_id) values (95, 'If there is a button instance called b1, you may add menu short cut by calling b1.setMnemonic(F), so the user may be able to use Alt+F to click the button.', 'How to add menushortcut to menu item?', 0, 'Card 95', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (96, 'Yes, just add a main() method to the applet.', 'Can you write a Java class that could be used both as an applet as well as an application?', 0, 'Card 96', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (97, 'AWT components are heavy-weight, whereas Swing components are lightweight. Heavy weight components depend on the local windowing toolkit. For example, java.awt.Button is a heavy weight component, when it is running on the Java platform for Unix platform, it maps to a real Motif button.', 'What is the difference between Swing and AWT components?', 0, 'Card 97', 2);
