insert into card (card_id, answer, question, rating, title, deck_id) values (99, 'Yes, since inheritance inherits everything from the super class and interface, it may make the subclass too clustering and sometimes error-prone when dynamic overriding or dynamic overloading in some situation.', 'Is there any limitation of using Inheritance?', 0, 'Card 99', 2);
insert into card (card_id, answer, question, rating, title, deck_id) values (100, 'When copying elements between different arrays, if the source or destination arguments are not arrays or their types are not compatible, an ArrayStoreException will be thrown.', 'When is the ArrayStoreException thrown?', 0, 'Card 100', 2);
