insert into card (card_id, answer, question, rating, title, deck_id) values (102, 'The code sleep(2000, 3); puts thread aside for exactly two seconds. The code wait(2000), causes a wait of up to two second. A thread could stop waiting earlier if it receives the notify() or notifyAll() call. The method wait() is defined in the class Object and the method sleep() is defined in the class Thread.', 'Whats the difference between the methods sleep() and wait()?', 0, 'Card 102', 3);
insert into card (card_id, answer, question, rating, title, deck_id) values (103, 'The ArithmeticException is thrown when integer is divided by zero or taking the remainder of a number by zero. It is never thrown in floating-point operations.', 'When ArithmeticException is thrown?', 0, 'Card 103', 3);
insert into card (card_id, answer, question, rating, title, deck_id) values (104, 'A transient variable is a variable that may not be serialized during Serialization and which is initialized by its default value during de-serialization,', 'What is a transient variable?', 0, 'Card 104', 3);
insert into card (card_id, answer, question, rating, title, deck_id) values (105, 'Synchronization is the capability to control the access of multiple threads to shared resources. synchronized keyword in java provides locking which ensures mutual exclusive access of shared resource and prevent data race.', 'What is synchronization?', 0, 'Card 105', 3);
insert into card (card_id, answer, question, rating, title, deck_id) values (106, 'The Collections API is a set of classes and interfaces that support operations on collections of objects.', 'What is the Collections API?', 0, 'Card 106', 3);
insert into card (card_id, answer, question, rating, title, deck_id) values (107, 'Garbage collection does not guarantee that a program will not run out of memory. It is possible for programs to use up memory resources faster than they are garbage collected. It is also possible for programs to create objects that are not subject to garbage collection.', 'Does garbage collection guarantee that a program will not run out of memory?', 0, 'Card 107', 3);
insert into card (card_id, answer, question, rating, title, deck_id) values (108, 'Panel is the immediate superclass. A panel provides space in which an application can attach any other component, including other panels.', 'The immediate superclass of the Applet class?', 0, 'Card 108', 3);
