insert into card (card_id, answer, question, rating, title, deck_id) values (132, 'Synchronized methods are methods that are used to control access to an object. A synchronized statement can only be executed after a thread has acquired the lock for the object or class referenced in the synchronized statement.', 'What are synchronized methods and synchronized statements?', 0, 'Card 132', 3);
insert into card (card_id, answer, question, rating, title, deck_id) values (133, 'Runtime polymorphism or dynamic method dispatch is a process in which a call to an overridden method is resolved at runtime rather than at compile-time. In this process, an overridden method is called through the reference variable of a superclass.', 'What is runtime polymorphism or dynamic method dispatch?', 0, 'Card 133', 3);
