insert into card (card_id, answer, question, rating, title, deck_id) values (355, 'C# is a modern, general-purpose, object-oriented programming language developed by Microsoft. C# is designed for Common Language Infrastructure (CLI), which consists of the executable code and runtime environment that allows use of various high-level languages on different computer platforms and architectures.', 'What is C#?', 0, 'Card 355', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (356, 'A Jagged array is an array of arrays.', 'What is Jagged Array in C#?', 0, 'Card 356', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (357, 'Yes! Using output parameters. A return statement can be used for returning only one value from a function. However, using output parameters, you can return two values from a function.', 'Can you return multiple values from a function in C#?', 0, 'Card 357', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (358, 'Output parameters are similar to reference parameters, except that they transfer data out of the method rather than into it. Reference parameter copies the reference to the memory location of an argument into the formal parameter. This means that changes made to the parameter affect the argument.', 'What is the difference between ref and out parameters?', 0, 'Card 358', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (359, 'A namespace is designed for providing a way to keep one set of names separate from another. The class names declared in one namespace does not conflict with the same class names declared in another.', 'What is namespace in C#?', 0, 'Card 359', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (360, 'using keyword is used to include a namespace in the program. A program generally has multiple using statements.', 'What is the purpose of using statement in C#?', 0, 'Card 360', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (361, 'Value type variables can be assigned a value directly. They are derived from the class System.ValueType.', 'What are value types in C#?', 0, 'Card 361', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (362, 'The reference types do not contain the actual data stored in a variable, but they contain a reference to the variables.', 'What are reference types in C#?', 0, 'Card 362', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (363, 'The Object Type is the ultimate base class for all data types in C# Common Type System (CTS). Object is an alias for System.Object class. The object types can be assigned values of any other types, value types, reference types, predefined or user-defined types. However, before assigning values, it needs type conversion.', 'Which class acts as a base class for all the data types in .net?', 0, 'Card 363', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (364, 'When a value type is converted to object type, it is called boxing.', 'What is boxing in C#?', 0, 'Card 364', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (365, 'When an object type is converted to a value type, it is called unboxing.', 'What is unboxing in C#?', 0, 'Card 365', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (366, 'Dynamic types are similar to object types except that type checking for object type variables takes place at compile time, whereas that for the dynamic type variables takes place at run time.', 'What is the difference between dynamic type variables and object type variables?', 0, 'Card 366', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (367, 'Encapsulation is defined as the process of enclosing one or more items within a physical or logical package. Encapsulation, in object oriented programming methodology, prevents access to implementation details.', 'What is encapsulation?', 0, 'Card 367', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (368, 'Encapsulation is implemented by using access specifiers.', 'How encapsulation is implemented in C#?', 0, 'Card 368', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (369, 'An access specifier defines the scope and visibility of a class member.', 'What is the purpose of an access specifier in C#?', 0, 'Card 369', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (370, 'Public access specifier allows a class to expose its member variables and member functions to other functions and objects. Any public member can be accessed from outside the class.', 'What is scope of a public member variable of a C# class?', 0, 'Card 370', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (371, 'Private access specifier allows a class to hide its member variables and member functions from other functions and objects. Only functions of the same class can access its private members. Even an instance of a class cannot access its private members.', 'What is scope of a private member variable of a C# class?', 0, 'Card 371', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (372, 'Protected access specifier allows a child class to access the member variables and member functions of its base class. This way it helps in implementing inheritance.', 'What is scope of a protected member variable of a C# class?', 0, 'Card 372', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (373, 'Internal access specifier allows a class to expose its member variables and member functions to other functions and objects in the current assembly. In other words, any member with internal access specifier can be accessed from any class or method defined within the application in which the member is defined.', 'What is scope of a Internal member variable of a C# class?', 0, 'Card 373', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (374, 'The protected internal access specifier allows a class to hide its member variables and member functions from other class objects and functions, except a child class within the same application. This is also used while implementing inheritance.', 'What is scope of a Protected Internal member variable of a C# class?', 0, 'Card 374', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (375, 'C# provides a special data types, the nullable types, to which you can assign normal range of values as well as null values.', 'What are nullable types in C#?', 0, 'Card 375', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (376, 'The null coalescing operator is used with the nullable value types and reference types. It is used for converting an operand to the type of another nullable (or not) value type operand, where an implicit conversion is possible.', 'What is the use of Null Coalescing Operator (??) in C#?', 0, 'Card 376', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (377, 'By using the params keyword, a method parameter can be specified which takes a variable number of arguments or even no argument.', 'Can you create a function in C# which can accept varying number of arguments?', 0, 'Card 377', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (378, 'No! additional parameters are not permitted after the params keyword in a method declaration. Only one params keyword is allowed in a method declaration.', 'Can you pass additional type of parameters after using params in function definition?', 0, 'Card 378', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (379, 'The Array class is the base class for all the arrays in C#. It is defined in the System namespace. The Array class provides various properties and methods to work with arrays.', 'Which class acts as a base class for all arrays in C#?', 0, 'Card 379', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (380, 'Using Array.sort(array) function. It sorts the elements in an entire one-dimensional Array using the IComparable implementation of each element of the Array.', 'How to sort an array in C#?', 0, 'Card 380', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (381, 'First sort the array using Array.sort(array) then reverse the same using Array.reverse(array) method.', 'How to sort an array in C# in descending order?', 0, 'Card 381', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (382, 'Default access specifier for a class type is internal.', 'What is the default access for a class?', 0, 'Card 382', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (383, 'Default access for the members is private.', 'What is the default access for a class member?', 0, 'Card 383', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (384, 'No! C# does not support multiple inheritance.', 'Is multiple inheritance supported in C#?', 0, 'Card 384', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (385, 'The word polymorphism means having many forms. In object-oriented programming paradigm, polymorphism is often expressed as one interface, multiple functions.', 'What is polymorphism?', 0, 'Card 385', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (386, 'Polymorphism can be static or dynamic. In static polymorphism, the response to a function is determined at the compile time. In dynamic polymorphism, it is decided at run-time.', 'What is the difference between static polymorphism and dynamic polymorphism?', 0, 'Card 386', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (387, 'The mechanism of linking a function with an object during compile time is called early binding. It is also called static binding.', 'What is early binding?', 0, 'Card 387', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (388, 'You can have multiple definitions for the same function name in the same scope. The definition of the function must differ from each other by the types and/or the number of arguments in the argument list. You cannot overload function declarations that differ only by return type.', 'What is function overloading?', 0, 'Card 388', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (389, 'Dynamic polymorphism is implemented by abstract classes and virtual functions.', 'How C# supports dynamic polymorphism?', 0, 'Card 389', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (390, 'When a class is declared sealed, it cannot be inherited.', 'What is a sealed class in C#?', 0, 'Card 390', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (391, 'No! It can not be created as abstract classes cannot be declared sealed.', 'How will you create sealed abstract class in C#?', 0, 'Card 391', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (392, 'When you have a function defined in a class that you want to be implemented in an inherited class(es), you use virtual functions. The virtual functions could be implemented differently in different inherited class and the call to these functions will be decided at runtime.', 'What are virtual functions in C#?', 0, 'Card 392', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (393, 'You can use the #if directive to create a conditional directive. Conditional directives are useful for testing a symbol or symbols to check if they evaluate to true. If they do evaluate to true, the compiler evaluates all the code between the #if and the next directive.', 'What is the use of conditional preprocessor directive in C#?', 0, 'Card 393', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (394, 'C# exceptions are represented by classes. The exception classes in C# are mainly directly or indirectly derived from the System.Exception class. Some of the exception classes derived from the System.Exception class are the System.ApplicationException and System.SystemException classes.', 'Which class acts as a base class for all exceptions in C#?', 0, 'Card 394', 8);
insert into card (card_id, answer, question, rating, title, deck_id) values (395, 'PHP is a recursive acronym for PHP: Hypertext Preprocessor. PHP is a server side scripting language that is embedded in HTML. It is used to manage dynamic content, databases, session tracking, even build entire e-commerce sites.', 'What is PHP?', 0, 'Card 395', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (396, 'All PHP code must be included inside one of the three special markup tags ate are recognised by the PHP Parser.', 'In how many ways you can embed PHP code in an HTML page?', 0, 'Card 396', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (397, 'The PHP configuration file, php.ini, is the final and most immediate way to affect PHPs functionality. The php.ini file is read each time PHP is initialized.in other words, whenever httpd is restarted for the module version or with each script execution for the CGI version. If your change isn.t showing up, remember to stop and restart httpd. If it still isn.t showing up, use phpinfo() to check the path to php.ini.', 'What is the purpose of php.ini file?', 0, 'Card 397', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (398, 'The PHP parsing engine needs a way to differentiate PHP code from other elements in the page. The mechanism for doing so is known as escaping to PHP.', 'What is escaping to PHP?', 0, 'Card 398', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (399, 'Whitespace is the stuff you type that is typically invisible on the screen, including spaces, tabs, and carriage returns (end-of-line characters). PHP whitespace insensitive means that it almost never matters how many whitespace characters you have in a row.one whitespace character is the same as many such characters.', 'What do you mean by having PHP as whitespace insensitive?', 0, 'Card 399', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (400, 'No, PHP is partially case sensitive.', 'Is PHP a case sensitive language?', 0, 'Card 400', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (401, 'To define a constant you have to use define() function and to retrieve the value of a constant, you have to simply specifying its name. Unlike with variables, you do not need to have a constant with a $.', 'How will you define a constant in PHP?', 0, 'Card 401', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (402, 'As indicated by the name, this function will return the value of the constant. This is useful when you want to retrieve value of a constant, but you do not know its name, i.e. It is stored in a variable or returned by a function.', 'What is the purpose of constant() function?', 0, 'Card 402', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (403, 'PHP provides a large number of predefined constants to any script which it runs known as magic constants.', 'What are PHP magic constants?', 0, 'Card 403', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (404, '_LINE_ − The current line number of the file.', 'What is the purpose of _LINE_ constant?', 0, 'Card 404', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (405, '_FILE_ − The full path and filename of the file. If used inside an include,the name of the included file is returned. Since PHP 4.0.2, _FILE_ always contains an absolute path whereas in older versions it contained relative path under some circumstances.', 'What is the purpose of _FILE_ constant?', 0, 'Card 405', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (406, '_FUNCTION_ − The function name. (Added in PHP 4.3.0) As of PHP 5 this constant returns the function name as it was declared (case-sensitive). In PHP 4 its value is always lowercased.', 'What is the purpose of _FUNCTION_ constant?', 0, 'Card 406', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (407, '_CLASS_ − The class name. (Added in PHP 4.3.0) As of PHP 5 this constant returns the class name as it was declared (case-sensitive). In PHP 4 its value is always lowercased.', 'What is the purpose of _CLASS_ constant?', 0, 'Card 407', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (408, '_METHOD_ − The class method name. (Added in PHP 5.0.0) The method name is returned as it was declared (case-sensitive).', 'What is the purpose of _METHOD_ constant?', 0, 'Card 408', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (409, 'break terminates the for loop or switch statement and transfers execution to the statement immediately following the for loop or switch.', 'What is the purpose of break statement?', 0, 'Card 409', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (410, 'continue causes the loop to skip the remainder of its body and immediately retest its condition prior to reiterating.', 'What is the purpose of continue statement?', 0, 'Card 410', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (411, 'Numeric array − An array with a numeric index. Values are stored and accessed in linear fashion.', 'What is numeric array?', 0, 'Card 411', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (412, 'Associative array − An array with strings as index. This stores element values in association with key values rather than in a strict linear index order.', 'What is associate array?', 0, 'Card 412', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (413, 'Multidimensional array − An array containing one or more arrays and values are accessed using multiple indices.', 'What is Multidimensional array?', 0, 'Card 413', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (414, 'PHP provides a function getenv() to access the value of all the environment variables.', 'How will you get environment variables in PHP?', 0, 'Card 414', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (415, 'One of the environemnt variables set by PHP is HTTP_USER_AGENT which identifies the users browser and operating system.', 'How will you get the browsers details using PHP?', 0, 'Card 415', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (416, 'The PHP rand() function is used to generate a random number. This function can generate numbers with-in a given range. The random number generator should be seeded to prevent a regular pattern of numbers being generated. This is achieved using the srand() function that specifiies the seed number as its argument.', 'How will you generate random numbers using PHP?', 0, 'Card 416', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (417, 'The PHP default variable $_PHP_SELF is used for the PHP script name and when you click submit button then same PHP script will be called.', 'What is the purpse $_PHP_SELF variable?', 0, 'Card 417', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (418, 'The PHP header() function supplies raw HTTP headers to the browser and can be used to redirect it to another location. The redirection script should be at the very top of the page to prevent any other part of the page from loading. The target is specified by the Location: header as the argument to the header() function. After calling this function the exit() function can be used to halt parsing of rest of the code.', 'How will you redirect a page using PHP?', 0, 'Card 418', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (419, 'The PHP provides $_GET associative array to access all the sent information using GET method.', 'How will you get information sent via get method in PHP?', 0, 'Card 419', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (420, 'The PHP provides $_POST associative array to access all the sent information using POST method.', 'How will you get information sent via post method in PHP?', 0, 'Card 420', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (421, 'The PHP $_REQUEST variable contains the contents of both $_GET, $_POST, and $_COOKIE. We will discuss $_COOKIE variable when we will explain about cookies. The PHP $_REQUEST variable can be used to get the result from form data sent with both the GET and POST methods.', 'What is the purpse $_REQUEST variable?', 0, 'Card 421', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (422, 'array() − Creates an array.', 'Which function will you use to create an array?', 0, 'Card 422', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (423, 'sort() − Sorts an array.', 'How can you sort an array?', 0, 'Card 423', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (424, 'To concatenate two string variables together, use the dot (.) operator.', 'How will you concatenate two strings?', 0, 'Card 424', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (425, 'The PHP $_REQUEST variable contains the contents of both $_GET, $_POST, and $_COOKIE. We will discuss $_COOKIE variable when we will explain about cookies. The PHP $_REQUEST variable can be used to get the result from form data sent with both the GET and POST methods.', 'What is the use of $_REQUEST variable?', 0, 'Card 425', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (426, 'If there is any problem in loading a file then the require() function generates a fatal error and halt the execution of the script whereas include() function generates a warning but the script will continue execution.', 'What is the difference between include() Function and require() Function?', 0, 'Card 426', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (427, 'The PHP fopen() function is used to open a file. It requires two arguments stating first the file name and then mode in which to operate. r mode opens the file for reading only and places the file pointer at the beginning of the file.', 'How will you open a file in readonly mode?', 0, 'Card 427', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (428, 'Once a file is opened using fopen() function it can be read with a function called fread(). This function requires two arguments. These must be the file pointer and the length of the file expressed in bytes.', 'How will you read a file in php?', 0, 'Card 428', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (429, 'The filess length can be found using the filesize() function which takes the file name as its argument and returns the size of the file expressed in bytes.', 'How will you get the size of a file in php?', 0, 'Card 429', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (430, 'Files existence can be confirmed using file_exist() function which takes file name as an argument.', 'How will you check if a file exists or not using php?', 0, 'Card 430', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (431, 'Yes! You can set a parameter to have a default value if the functions caller doesnt pass it.', 'Can you assign the default values to a function parameters?', 0, 'Card 431', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (432, 'PHP provides many ways to access cookies. Simplest way is to use either $_COOKIE or $HTTP_COOKIE_VARS variables.', 'How will you get cookies using PHP?', 0, 'Card 432', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (433, 'You can use isset() function to check if a cookie is set or not.', 'How will you make a check that a cookie is set or not?', 0, 'Card 433', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (434, 'To delete a cookie you should call setcookie() with the name argument only.', 'How will you delete a cookie?', 0, 'Card 434', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (435, 'A PHP session is easily started by making a call to the session_start() function.This function first checks if a session is already started and if none is started then it starts one. It is recommended to put the call to session_start() at the beginning of the page.', 'How will you start a session in PHP?', 0, 'Card 435', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (436, 'Session variables are stored in associative array called $_SESSION[]. These variables can be accessed during lifetime of a session.', 'How will you access session variables in PHP?', 0, 'Card 436', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (437, 'Make use of isset() function to check if session variable is already set or not.', 'How will you check if session variable is already set or not in PHP?', 0, 'Card 437', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (438, 'A PHP session can be destroyed by session_destroy() function.', 'How will you destroy the session?', 0, 'Card 438', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (439, 'This is a global PHP variable. This variable is an associate double dimension array and keeps all the information related to uploaded file.', 'What is the purpose of $_FILES variable in PHP?', 0, 'Card 439', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (440, '$GLOBALS − Contains a reference to every variable which is currently available within the global scope of the script. The keys of this array are the names of the global variables.', 'What is the purpose of $GLOBALS variable in PHP?', 0, 'Card 440', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (441, '$_SERVER − This is an array containing information such as headers, paths, and script locations. The entries in this array are created by the web server. There is no guarantee that every web server will provide any of these. See next section for a complete list of all the SERVER variables.', 'What is the purpose of $_SERVER variable in PHP?', 0, 'Card 441', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (442, '$_COOKIE − An associative array of variables passed to the current script via HTTP cookies.', 'What is the purpose of $_COOKIE variable in PHP?', 0, 'Card 442', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (443, '$_SESSION − An associative array containing session variables available to the current script.', 'What is the purpose of $_SESSION variable in PHP?', 0, 'Card 443', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (444, '$_PHP_SELF − A string containing PHP script file name in which it is called.', 'What is the purpose of $_PHP_SELF variable in PHP?', 0, 'Card 444', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (445, '$php_errormsg − $php_errormsg is a variable containing the text of the last error message generated by PHP.', 'What is the purpose of $php_errormsg variable in PHP?', 0, 'Card 445', 9);
insert into card (card_id, answer, question, rating, title, deck_id) values (446, 'ereg() − The ereg() function searches a string specified by string for a string specified by pattern, returning true if the pattern is found, and false otherwise.', 'How ereg() function works?', 0, 'Card 446', 10);
insert into card (card_id, answer, question, rating, title, deck_id) values (447, 'eregi() − The eregi() function searches throughout a string specified by pattern for a string specified by string. The search is not case sensitive.', 'How eregi() function works?', 0, 'Card 447', 10);
insert into card (card_id, answer, question, rating, title, deck_id) values (448, 'The split() function will divide a string into various elements, the boundaries of each element based on the occurrence of pattern in string.', 'How split() function works?', 0, 'Card 448', 10);
insert into card (card_id, answer, question, rating, title, deck_id) values (449, 'preg_match() - The preg_match() function searches string for pattern, returning true if pattern exists, and false otherwise.', 'How preg_match() function works?', 0, 'Card 449', 10);
insert into card (card_id, answer, question, rating, title, deck_id) values (450, 'The preg_split() function operates exactly like split(), except that regular expressions are accepted as input parameters for pattern.', 'How preg_split() function works?', 0, 'Card 450', 10);
insert into card (card_id, answer, question, rating, title, deck_id) values (451, 'Using getMessage() method of Exception class which returns the message of exception.', 'How will you retrieve the error message using Exception class in PHP when error occured?', 0, 'Card 451', 10);
insert into card (card_id, answer, question, rating, title, deck_id) values (452, 'Using getCode() method of Exception class which returns the code of exception.', 'How will you retrieve code of exception using Exception class in PHP when error occured?', 0, 'Card 452', 10);
insert into card (card_id, answer, question, rating, title, deck_id) values (453, 'Using getFile() method of Exception class which returns source filename.', 'How will you retrieve source filename using Exception class in PHP when error occured?', 0, 'Card 453', 10);
insert into card (card_id, answer, question, rating, title, deck_id) values (454, 'Using getLine() method of Exception class which returns source line.', 'How will you retrieve source line using Exception class in PHP when error occured?', 0, 'Card 454', 10);
insert into card (card_id, answer, question, rating, title, deck_id) values (455, 'Using getTrace() method of Exception class which returns array of the backtrace.', 'How will you retrieve stack trace using Exception class in PHP when error occured?', 0, 'Card 455', 10);
insert into card (card_id, answer, question, rating, title, deck_id) values (456, 'Using getTraceAsString() method of Exception class which returns formated string of trace.', 'How will you retrieve formated string of trace in PHP when error occured?', 0, 'Card 456', 10);
insert into card (card_id, answer, question, rating, title, deck_id) values (457, 'PHPs time() function gives you all the information that you need about the current date and time. It requires no arguments but returns an integer.', 'How will you get the current date and time using PHP?', 0, 'Card 457', 10);
insert into card (card_id, answer, question, rating, title, deck_id) values (458, 'The function getdate() optionally accepts a time stamp and returns an associative array containing information about the date. If you omit the time stamp, it works with the current time stamp as returned by time().', 'What is the purpose of getdate() function?', 0, 'Card 458', 10);
insert into card (card_id, answer, question, rating, title, deck_id) values (459, 'The date() function returns a formatted string representing a date. You can exercise an enormous amount of control over the format that date() returns with a string argument that you must pass to it.', 'What is the purpose of date() function?', 0, 'Card 459', 10);
insert into card (card_id, answer, question, rating, title, deck_id) values (460, 'PHP 5s new SimpleXML module makes parsing an XML document, well, simple. It turns an XML document into an object that provides structured access to the XML. To create a SimpleXML object from an XML document stored in a string, pass the string to simplexml_load_string( ). It returns a SimpleXML object.', 'How will you parse an XML document using PHP?', 0, 'Card 460', 10);
insert into card (card_id, answer, question, rating, title, deck_id) values (461, 'Yes!', 'Can you create a class in PHP?', 0, 'Card 461', 10);
insert into card (card_id, answer, question, rating, title, deck_id) values (462, 'PHP provides a special function called __construct() to define a constructor. You can pass as many as arguments you like into the constructor function.', 'How will you add a constructor function to a PHP class?', 0, 'Card 462', 10);
insert into card (card_id, answer, question, rating, title, deck_id) values (463, 'Like a constructor function you can define a destructor function using function __destruct(). You can release all the resourceses with-in a destructor.', 'How will you add a destructor function to a PHP class?', 0, 'Card 463', 10);
insert into card (card_id, answer, question, rating, title, deck_id) values (464, 'The variable $this is a special variable and it refers to the same object ie. itself.', 'How will you access the reference to same object within the object in PHP?', 0, 'Card 464', 10);
insert into card (card_id, answer, question, rating, title, deck_id) values (465, 'Function definitions in child classes override definitions with the same name in parent classes. In a child class, we can modify the definition of a function inherited from parent class.', 'What is function overriding?', 0, 'Card 465', 10);
insert into card (card_id, answer, question, rating, title, deck_id) values (466, 'Interfaces are defined to provide a common function names to the implementors. Different implementors can implement those interfaces according to their requirements. You can say, interfaces are skeltons which are implemented by developers.', 'What are interfaces in PHP?', 0, 'Card 466', 10);
insert into card (card_id, answer, question, rating, title, deck_id) values (467, 'PHP 5 introduces the final keyword, which prevents child classes from overriding a method by prefixing the definition with final. If the class itself is being defined final then it cannot be extended.', 'What is the use of final keyword?', 0, 'Card 467', 10);
insert into card (card_id, answer, question, rating, title, deck_id) values (468, 'Yes! JavaScript is a case-sensitive language. This means that language keywords, variables, function names, and any other identifiers must always be typed with a consistent capitalization of letters.', 'Is JavaScript a case-sensitive language?', 0, 'Card 468', 11);
insert into card (card_id, answer, question, rating, title, deck_id) values (469, 'A function in JavaScript can be either named or anonymous.', 'How many types of functions JavaScript supports?', 0, 'Card 469', 11);
insert into card (card_id, answer, question, rating, title, deck_id) values (470, 'An anonymous function can be defined in similar way as a normal function but it would not have any name.', 'How to define a anonymous function?', 0, 'Card 470', 11);
insert into card (card_id, answer, question, rating, title, deck_id) values (471, 'Yes! An anonymous function can be assigned to a variable.', 'Can you assign a anonymous function to a variable?', 0, 'Card 471', 11);
insert into card (card_id, answer, question, rating, title, deck_id) values (472, 'Yes! An anonymous function can be passed as an argument to another function.', 'Can you pass a anonymous function as an argument to another function?', 0, 'Card 472', 11);
insert into card (card_id, answer, question, rating, title, deck_id) values (473, 'JavaScript variable arguments represents the arguments passed to a function.', 'What is arguments object in JavaScript?', 0, 'Card 473', 11);
insert into card (card_id, answer, question, rating, title, deck_id) values (474, 'JavaScript famous keyword this always refers to the current context.', 'What is the purpose of this operator in JavaScript?', 0, 'Card 474', 11);
insert into card (card_id, answer, question, rating, title, deck_id) values (475, 'A local variable takes precedence over a global variable with the same name.', 'Which type of variable among global and local, takes precedence over other if names are same?', 0, 'Card 475', 11);
insert into card (card_id, answer, question, rating, title, deck_id) values (476, 'A callback is a plain JavaScript function passed to some method as an argument or option. Some callbacks are just events, called to give the user a chance to react when a certain state is triggered.', 'What is callback?', 0, 'Card 476', 11);
insert into card (card_id, answer, question, rating, title, deck_id) values (477, 'Closures are created whenever a variable that is defined outside the current scope is accessed from within some inner scope.', 'What is closure?', 0, 'Card 477', 11);
insert into card (card_id, answer, question, rating, title, deck_id) values (478, 'charAt() method returns the character at the specified index.', 'Which built-in method returns the character at the specified index?', 0, 'Card 478', 11);
insert into card (card_id, answer, question, rating, title, deck_id) values (479, 'concat() method returns the character at the specified index.', 'Which built-in method combines the text of two strings and returns a new string?', 0, 'Card 479', 11);
insert into card (card_id, answer, question, rating, title, deck_id) values (480, 'forEach() method calls a function for each element in the array.', 'Which built-in method calls a function for each element in the array?', 0, 'Card 480', 11);
insert into card (card_id, answer, question, rating, title, deck_id) values (481, 'indexOf() method returns the index within the calling String object of the first occurrence of the specified value, or −1 if not found.', 'Which built-in method returns the index within the calling String object of the first occurrence of the specified value?', 0, 'Card 481', 11);
insert into card (card_id, answer, question, rating, title, deck_id) values (482, 'length() method returns the length of the string.', 'Which built-in method returns the length of the string?', 0, 'Card 482', 11);
insert into card (card_id, answer, question, rating, title, deck_id) values (483, 'pop() method removes the last element from an array and returns that element.', 'Which built-in method removes the last element from an array and returns that element?', 0, 'Card 483', 11);
insert into card (card_id, answer, question, rating, title, deck_id) values (484, 'push() method adds one or more elements to the end of an array and returns the new length of the array.', 'Which built-in method adds one or more elements to the end of an array and returns the new length of the array?', 0, 'Card 484', 11);
insert into card (card_id, answer, question, rating, title, deck_id) values (485, 'reverse() method reverses the order of the elements of an array −− the first becomes the last, and the last becomes the first.', 'Which built-in method reverses the order of the elements of an array?', 0, 'Card 485', 11);
insert into card (card_id, answer, question, rating, title, deck_id) values (486, 'sort() method sorts the elements of an array.', 'Which built-in method sorts the elements of an array?', 0, 'Card 486', 11);
insert into card (card_id, answer, question, rating, title, deck_id) values (487, 'substr() method returns the characters in a string beginning at the specified location through the specified number of characters.', 'Which built-in method returns the characters in a string beginning at the specified location?', 0, 'Card 487', 11);
insert into card (card_id, answer, question, rating, title, deck_id) values (488, 'toLowerCase() method returns the calling string value converted to lower case.', 'Which built-in method returns the calling string value converted to lower case?', 0, 'Card 488', 11);
