insert into card (card_id, answer, question, rating, title, deck_id) values (492, 'JavaScript can also manipulate cookies using the cookie property of the Document object. JavaScript can read, create, modify, and delete the cookie or cookies that apply to the current web page.', 'Can you access Cookie using javascript?', 0, 'Card 492', 11);
insert into card (card_id, answer, question, rating, title, deck_id) values (493, 'Sometimes you will want to delete a cookie so that subsequent attempts to read the cookie return nothing. To do this, you just need to set the expiration date to a time in the past.', 'How to delete a Cookie using JavaScript?', 0, 'Card 493', 11);
insert into card (card_id, answer, question, rating, title, deck_id) values (494, 'JavaScript helps you to implement this functionality using print function of window object. The JavaScript print function window.print() will print the current web page when executed.', 'How to print a web page using javascript?', 0, 'Card 494', 11);
